import React, { Component } from "react";
import {
  TextField,
  Container,
  Button,
  Tabs,
  Tab,
  Typography,
  Box
} from "@material-ui/core";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      id={`wrapped-tabpanel-${index}`}
      aria-labelledby={`wrapped-tab-${index}`}
      {...other}
    >
      <Box p={3}>{children}</Box>
    </Typography>
  );
}

export default class Lgon extends Component {
  state = {
    value: "one"
  };

  render() {
    return (
      <div style={{}}>
        <Tabs
          style={{ color: "blue", marginTop: 20, marginLeft: 200 }}
          value={this.state.value}
          onChange={(event, newValue) => {
            this.setState({ value: newValue });
            console.log(newValue);
          }}
        >
          <Tab value="zero" label="LOGIN"></Tab>
          <Tab value="one" label="REGISTER"></Tab>
        </Tabs>
        <TabPanel value={this.state.value} index="zero">
          <Container>
            <TextField
              style={{ width: 500 }}
              label="Email"
              margin="dense"
              variant="outlined"
            />
            <br />
            <TextField
              style={{ width: 500 }}
              label="Passworld"
              margin="dense"
              variant="outlined"
              type="password"
            />
            <br />
            <Button
              style={{
                width: 500,
                marginTop: 50,
                background: "yellow",
                color: "black"
              }}
            >
              LOGIN
            </Button>
          </Container>
        </TabPanel>
        <TabPanel value={this.state.value} index="one">
          Item Two
        </TabPanel>
      </div>
    );
  }
}

